import React from "react";
import { NavLink, useNavigate } from "react-router-dom";
import NavBar from "./NavBar";
const Help = () => {
  const navigate = useNavigate();
  return (
    <>
      <nav>
        <h1>Hii This is Help page</h1>
        {/* <NavBar /> */}
        <button
          onClick={() => {
            navigate(-1);
          }}
        >
          Go Back
        </button>
      </nav>
    </>
  );
};

export default Help;
